import { StatusBar } from 'expo-status-bar';
import React from 'react';
import { StyleSheet, Text, View, Image, TextInput, Button, Alert } from 'react-native';
import LinearGradient from 'react-native-linear-gradient';

export default function App() {
  return (
    <LinearGradient colors={['#4c669f', '#3b5998', '#192f6a']} style={styles.linearGradient}>
    <View style={styles.body}>
      {/* <Text>Enfim meu primeiro APP!</Text>
      <StatusBar style="auto" /> */}
      <View style={styles.navbar}>
      <Image source={require('./assets/logo2.png')} style={styles.logo}/>
      </View>
      <View style={styles.container}>


        <TextInput style={styles.input} placeholder="Digite seu usuario"/>

        <TextInput style={styles.input} placeholder="Digite sua senha"
        secureTextEntry={true} />

        <Button class="button" title="Login" onPress={() => Alert.alert('Alerta de clique!')}/> 
        <Button class="button" title="limpa" onPress={() => Alert.alert('Alerta de clique!')} />
      </View>

    </View>
    </LinearGradient>
  );
}

const styles = StyleSheet.create({
  body:{
    flex: 1,

  },

  logo:{
    marginTop: '150px',
    width: '250px',
    height: '100px'
  },

  navbar:{

    alignItems: 'center',
    justifyContent: 'center',

    margin: '10px',

    width: '100%',
    height: '110px'
  },
  container: {
    flex: 1,
    alignItems: 'center',
    justifyContent: 'center',
  },

  input:{
    marginTop: 10,
    padding: 10,
    width: 350,
    backgroundColor:'#fff',
    fontSize: 15,
    borderRadius: 50

  },
  button: {
    width: 200
  }
});
